(11, 'forgot_passwd', 'email', '<template deflang="en">\r\n<FROM email="Demo Theater &lt;demo@phpmyticket.com&gt;"/>\r\n<TO email="$user_firstname $user_lastname &lt;$user_email&gt;"/>\r\n\r\n<subject lang="en" value="Your new password"/>\r\n<subject lang="fr" value="Votre nouveau mot de passe"/>\r\n<subject lang="it" value="La Sua nuova parola d''accesso"/>\r\n\r\n<text lang="en">\r\nDear $user_firstname $user_lastname!\r\n\r\nThere is your new password: $new_password\r\n\r\nHave a nice day\r\n\r\n</text>\r\n\r\n<html lang="en">\r\n<p>Dear $user_firstname $user_lastname!</p>\r\n\r\n<p>There is your new password: <b>$new_password</b></p>\r\n\r\n<p>Have a nice day!</p>\r\n \r\n\r\n</html>\r\n\r\n<text lang="fr">\r\nCher/ChÃƒÂ¨re $user_firstname $user_lastname!\r\n\r\nVotre nouveau mot de passe est: $new_password\r\n\r\nMeilleures salutations\r\n\r\n</text>\r\n\r\n<html lang="fr">\r\n<p>Cher/ChÃƒÂ¨re $user_firstname $user_lastname!</p>\r\n\r\n<p>Votre nouveau mot de passe est: <b>$new_password</b></p>\r\n\r\n<p>Meilleures salutations</p>\r\n \r\n</html>\r\n\r\n\r\n<text lang="it">\r\nGentile/Gentilissima $user_firstname $user_lastname!\r\n\r\nLa Sua nuova parola d''accesso ÃƒÂ¨: $new_password\r\nDistinti saluti\r\n\r\n</text>\r\n\r\n<html lang="it">\r\n<p>Gentile/Gentilissima $user_firstname $user_lastname!</p>\r\n\r\n<p>La Sua nuova parola d''accesso ÃƒÂ¨: <b>$new_password</b></p>\r\n\r\n<p>Distinti saluti</p>\r\n \r\n\r\n</html>\r\n\r\n</template>\r\n', '2008-11-29 18:31:01', 'comp', '/*this is a generated code. do not edit!\r\nproduced Saturday 29th 2008f November 2008 06:31:01 PM\r\n*/\r\n\r\nclass TT_forgot_passwd {\r\n  var $object_id;\r\n  var $engine;\r\n\r\n  function TT_forgot_passwd(){}\r\n  function build(&$mail,&$data,$lang="en"){\n    if($lang=="en"){\n      $mail->setSubject("Your new password");\n      $mail->setTextCharset("UTF-8");\n      $mail->setHtmlCharset("UTF-8");\n      $mail->setHeadCharset("UTF-8");\n      $mail->setHtml("\n<p >Dear ".$data[